import React from "react";
import Cards from "./components/Cards";
import seriesData from "./components/SData";

function App() {
  return (
    <>
      <h1 className="heading">Collection of My Best Web Series </h1>
    { <Cards
        imgSrc = {seriesData[0].imgSrc}
        ottPf = {seriesData[0].ottPf}
        seriesName = {seriesData[0].seriesName}
        imdb = {seriesData[0].imdb}
        srcLink = {seriesData[0].srcLink}
      />
  }
      <Cards
        imgSrc = {seriesData[1].imgSrc}
        ottPf = {seriesData[1].ottPf}
        seriesName = {seriesData[1].seriesName}
        imdb = {seriesData[1].imdb}
        srcLink = {seriesData[1].srcLink}
      />

      <Cards
        imgSrc = {seriesData[2].imgSrc}
        ottPf = {seriesData[2].ottPf}
        seriesName = {seriesData[2].seriesName}
        imdb = {seriesData[2].imdb}
        srcLink = {seriesData[2].srcLink}
      />

      <Cards
        imgSrc = {seriesData[3].imgSrc}
        ottPf = {seriesData[3].ottPf}
        seriesName = {seriesData[3].seriesName}
        imdb = {seriesData[3].imdb}
        srcLink = {seriesData[3].srcLink}
      />

      <Cards
        imgSrc = {seriesData[4].imgSrc}
        ottPf = {seriesData[4].ottPf}
        seriesName = {seriesData[4].seriesName}
        imdb = {seriesData[4].imdb}
        srcLink = {seriesData[4].srcLink}
      />

      <Cards
        imgSrc = {seriesData[5].imgSrc}
        ottPf = {seriesData[5].ottPf}
        seriesName = {seriesData[5].seriesName}
        imdb = {seriesData[5].imdb}
        srcLink = {seriesData[5].srcLink}
      />
    </>
  );
}

export default App;
